action_function.value:
async () => {
  if (confirm("Are you sure to update this data?")) {
    await db.t_schedule.update({
      where: {
        id: Number(new URLSearchParams(window.location.search).get("id")),
      },
      data: {
        schedule_name: local.scheduleName,
        id_activity_type: local.selectedActivity.value,
        start_date: local.startDate,
        end_date: local.endDate,
        duration: local.duration,
        location: local.location,
        updated_date: new Date(),
        updated_by: user.id,
        pic: local.selectedSenior.value,
      },
    });
    local.render();
    navigate("/institution/data/schedule");
  }
}

